import { NgModule } from '@angular/core';
import { CategoryService } from './category.service';
import { CategoryComponent } from './category.component';
import { CategoryCreateComponent } from '../category-create/category-create/category-create.component';
import { CategoryFormComponent } from '../category-form/category-form/category-form.component';
import { RouterModule } from '@angular/router';
import { FormsModule,ReactiveFormsModule } from '@angular/forms';
import { CommonModule } from '@angular/common';
import { CategoryEditComponent } from '../product-edit/product-edit/category-edit.component';
@NgModule({
  declarations: [
    CategoryComponent,
    CategoryFormComponent,
    CategoryCreateComponent,
    CategoryEditComponent,
  ],
  imports: [
  CommonModule,ReactiveFormsModule,FormsModule,RouterModule
  ],
  
  exports: [
    CategoryComponent,
    CategoryFormComponent,
    CategoryCreateComponent,
    CategoryEditComponent,
  ],
  providers: [CategoryService]
},)
